import React, { useState, useEffect } from "react";
import axios from "axios";

const fetchDetails = "http://localhost:8080/students/details";
const headers = {
  method: "GET",
  credentials: "include",
  headers: {
    "Content-Type": "application/json",
  },
};

function ViewApplication({ activeId }) {
  const [studentApplicationDetails, setStudentApplicationDetails] = useState({
    receiver: "hi",
    gpa: "",
    classification: "",
    resumeLink: "",
    message: "",
    applicationId: "8",
    decision: "IN-PROGRESS",
  });

  const [receivedDetails, setReceivedDetails] = useState({
    firstName: "",
    lastName: "",
    cwid: "",
    major: "",
  });

  useEffect(() => {
    fetch(fetchDetails, headers)
      .then((res) => {
        return res.json();
      })
      .then((res) => {
        setReceivedDetails({
          firstName: res.firstName,
          lastName: res.lastName,
          cwid: res.cwid,
          major: res.major,
        });
      })
      .catch((e) => console.log(e));

    fetch(
      "http://localhost:8080/students/application-details/" + activeId,
      headers
    )
      .then((res) => {
        return res.json();
      })
      .then((res) => {
        console.log(res);
        // setReceivedDetails({
        //   firstName: res.firstName,
        //   lastName: res.lastName,
        //   cwid: res.cwid,
        //   major: res.major,
        // });
      })
      .catch((e) => console.log(e));
  }, []);

  return (
    <div className="new_project m-5">
      <span className="fs-2">Emerging Scholar Application</span>
      <div className="mb-5"> </div>
      <form>
        <div className="row">
          <div className="col md-4 mb-3">
            <label htmlFor="firstName"> First Name </label>
            <br />
            <input
              readOnly
              name="firstName"
              id="firstName"
              type="text"
              className="form-control mt-3"
              value={receivedDetails.firstName}
            />
          </div>
          <div className="col-md-4 mb-3">
            <label htmlFor="lastName"> Last Name </label>
            <br />
            <input
              readOnly
              name="lastName"
              id="lastName"
              type="text"
              className="form-control mt-3"
              value={receivedDetails.lastName}
            />
          </div>
          <div className="col-md-4 mb-3">
            <label htmlFor="gpa"> GPA </label>
            <br />
            <input
              readOnly
              name="gpa"
              id="gpa"
              type="text"
              className="form-control mt-3"
            />
          </div>
        </div>
        <div className="row">
          <div className="col-md-4 mb-3">
            <label htmlFor="classification"> Classification </label>
            <br />
            <input
              readOnly
              name="classification"
              id="classification"
              type="text"
              className="form-control mt-3"
            />
          </div>
          <div className="col-md-4 mb-3">
            <label htmlFor="major"> Major </label>
            <br />
            <input
              name="major"
              id="major"
              type="text"
              readOnly
              value={receivedDetails.major}
              className="form-control mt-3"
            />
          </div>
          <div className="col-md-4 mb-3">
            <label htmlFor="cwid"> CWID </label>
            <br />
            <input
              name="cwid"
              id="cwid"
              type="text"
              readOnly
              value={receivedDetails.cwid}
              className="form-control mt-3"
            />
          </div>
        </div>
        <div>
          <label htmlFor="resume_link"> Link to your resume</label>
          <br />
          <input
            readOnly
            type="url"
            id="resume_link"
            name="resumeLink"
            className="form-control mt-3"
          />
        </div>

        <div className="mt-3">
          <label htmlFor="message"> Message to Professor </label>
          <br />
          <textarea
            readOnly
            type="text"
            id="message"
            name="message"
            className="form-control mt-3"
            rows={8}
          />
        </div>
      </form>
    </div>
  );
}
export default ViewApplication;
